	function calculateMA(period, data) {
		var array = [];
		for(i=period-1,length=data.length-1;i<=length;++i) {
			var sum = 0;
			for( j=0; j<period; ++j ) {
				sum += data[i-j][3];
			}
			array.push([parseFloat(sum/period), data[i][4]]);
		}

		return array;
	}

	function calculateEMA(period, data) {
		var alpha = 2 / (period + 1);

		var array = [];
		for(i=period-1,length=data.length-1;i<=length;++i) {
			var numerator = 0;
			var denominator = 0;
			for( j=0; j<period; ++j ) {
				numerator += data[i-j][3] * Math.pow( (1-alpha), j);
				denominator += Math.pow( (1-alpha), j);
			}

			array.push([parseFloat(numerator/denominator), data[i][4]]);
		}

		return array;
	}

